import React from "react";
import Template from "./Template";

function Contact() {
    return (
        <div className="Contact">
            <Template
                h1="Contact"
                h2="Please Leave your information here and I will get back to you!"
                description={
                    "Blanks"
                }
            />

        </div>
    )
}

export default Contact;
